    var getRandomName = function () {
        var randomNumber = Math.floor(Math.random() * firstName.length + 1);
        var randomName = firstName[randomNumber];
        return randomName;
    }

    var getRandomSurname = function () {
        var randomNumber = Math.floor(Math.random() * surname.length + 1);
        var randomSurname = surname[randomNumber];
        return randomSurname;
    }

    var makeUL = function () {
        //Scroll Down A Little 
        $("html, body").animate({scrollTop: $("#generateButton").offset().top}, 800);
        //Clear Existing Results
        document.getElementById("results").innerHTML = "";
        //Random Surname Variables
        var randomSurnameYes = document.getElementById("surnameYes");
        //Set Surname Variable
        var appendSurname =  document.getElementById("appendSurname");
        console.log(appendSurname.value);
        //Create Array    
        var set = [];
        //Retrieve Amount of Results
        function quantity () {
            var amount = document.getElementById("quantityValue").value;
            if (amount < 26) {
                return document.getElementById("quantityValue").value;
            }
            else if (amount > 26) {
                return 25;
            }
        }
        //Push Names to Array
        for (var i = 0; i < quantity(); i++) {
            //If Random Surname And No Append Surname
            if (randomSurnameYes.checked && appendSurname.value == "Surname or Middle-name") {
                set.push(getRandomName() + " " + getRandomSurname())
                console.log("if 1");
            }
            //If Random Surname And Append Surname
            else if (randomSurnameYes.checked && appendSurname.value !== "Surname or Middle-name") {
                set.push(getRandomName() + " " + appendSurname.value + " " + getRandomSurname());
                console.log("if 2");                       
            }
            //If No Random And Append Surname
            else if (randomSurnameYes.checked == false && appendSurname.value !== "Surname or Middle-name") {
                set.push(getRandomName() + " " + appendSurname.value);
                console.log("if 3"); 
            }
            //Basic First Name
            else {
                set.push(getRandomName());
                console.log("else");
            }
        }
        //Create List
        var list = document.createElement("ol");
        for (var i = 0; i < set.length; i++) {
            var item = document.createElement("li");
            item.appendChild(document.createTextNode(set[i]));
            list.appendChild(item);
        }
        document.getElementById("results").appendChild(list);
    }
    //Button Push Event Listener
    var genBtn = document.getElementById("generateButton");
    genBtn.addEventListener("click", makeUL);
